import React from 'react';
import { 
  EmptyCartContainer, 
  CartLogoComponent,
  EmptyTitle,
  EmptySubtitle
 } from './cart-container.styles';


const CartContainer = () => {
  return (
    <EmptyCartContainer>
      <CartLogoComponent/>
      <EmptyTitle>
        Your cart is empty
      </EmptyTitle>
    </EmptyCartContainer>
  )
}

export default CartContainer;
